      return <Navigate to="/doctor" replace />;
    }
    // Include additional conditions as needed
  }, []);

  function displayElm(x) {
    setElm(x)
    console.log(x)
  }
  return (
    <div className='nu'>
      <NurseNave />
      <div className='sAndC1'>
        <NurseSide disp={displayElm} />
        <NurseContent elm1={elm} />
      </div>
    </div>
  )
}

export default Nurse
